                con[fieldName] = importer.canvas().ownerDocument.getElementById(id);
                return
            }
            importer.addPatchSite(con, fieldName, id);
        };

        restore(literal.sourceObj, 'sourceObj');
        restore(literal.targetObj, 'targetObj');

        return con;
    }
});

