function doAction() {
    if (!this.owner.textChunks) {
        alertOK("Drop me on a Text morph!");
        return;
    }

    if (this.owner != this.lastOwner) {
        this.lastOwner = this.owner;
        this.defaced = false;
    }

    if (this.defaced) {
        this.owner.unEmphasizeAll();
        this.owner.highlightSyntax();
        this.defaced = false;
    } else {
        this.defaced = true;
        this.owner.textChunks.each(function(ea) {
            var c = ea.getStyle().color;
            c = (c == Color.black ? c = Color.gray : c);
            var hsb = c.toHSB();
            c = Color.hsb(hsb[0], hsb[1] % 0.7, hsb[2]);
            ea.styleText({
                color: c.withA(0.5),
                backgroundColor: c.withA(0.3)
            });
        });
    }
}

